import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="Navbar">
      <header className="App-header">
        <ul>
          <li>
            <a href="#">ABOUT</a>
          </li>
          <li>
            <a href="#">CONTACT</a>
          </li>
          <li>
            <a href="#">BLOG</a>
          </li>
          </ul>
      </header>
    </div>
  );
}

export default App;
